const CustomSocialBar = () => {
  const socialLinks = [
    {
      name: "Twitter",
      url: "https://twitter.com/your-twitter-handle",
      icon: "üê¶",
    },
    {
      name: "LinkedIn",
      url: "https://linkedin.com/in/your-linkedin-profile",
      icon: "üíº",
    },
    {
      name: "GitHub",
      url: "https://github.com/your-github-username",
      icon: "üêô",
    },
    {
      name: "Instagram",
      url: "https://instagram.com/your-instagram-handle",
      icon: "üì∑",
    },
  ];

  return (
    <div style={styles.socialBar}>
      {socialLinks.map((link) => (
        <a
          key={link.name}
          href={link.url}
          target="_blank"
          rel="noopener noreferrer"
          style={styles.socialLink}
          aria-label={link.name}
        >
          {link.icon}
        </a>
      ))}
    </div>
  );
};

const styles = {
  socialBar: {
    display: "flex",
    justifyContent: "center",
    gap: "15px",
    margin: "20px 0",
  },
  socialLink: {
    fontSize: "24px",
    color: "#333",
    textDecoration: "none",
    transition: "color 0.3s ease",
  },
};

export default CustomSocialBar;
